import React from "react";

const styles = {
    'topnav' : {
        backgroundColor: '#333',
        overflow: 'hidden',
        'a' : {
            float: 'left',
            color: '#f2f2f2',
            textAlign: 'center',
            padding: '14px 16px',
            textDecoration: 'none',
            fontSize: '17px',
        },
        'a:hover' : {
            backgroundColor: '#ddd',
            color: 'black'
          },
          'a.active' : {
            backgroundColor: '#04AA6D',
            color: 'white',
          }
      },
}

function NavBar(props) {
    return (
        <ul>
        <li><a href="https://react-bootstrap.github.io/components/navbar/">Home</a></li>
  <li><a href="https://react-bootstrap.github.io/components/navbar/">News</a></li>
  <li><a href="https://react-bootstrap.github.io/components/navbar/">Contact</a></li>
  <li><a href="https://react-bootstrap.github.io/components/navbar/">About</a></li>
</ul>
  );
}

export default NavBar;
